import React, { Component } from 'react'
import Item from '../Item'

export default class List extends Component {
  render() {
    return (
      <div >
        <ul>
          {this.props.todoList.map(item=>{
            return <li key={item.id}><Item></Item></li>
          })}
        </ul>
      </div>
    )
  }
}
